import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <div>
        <Link to="/intro">
          <a class="adventure btn">I've been here before</a>
        </Link>
        <Link to="/signin">
          <a class="iknow btn">I've been here before</a>
        </Link>
      </div>
    );
  }
}
